import React from 'react';
import propTypes from 'prop-types'

const FoodILike = [
  {
    id:1,
    name: "Kimchi",
    image:
    "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.F_ojzEqFOvx9NEuIr6Ut9gHaFD%26pid%3DApi&f=1",
    rating: 5
  },
  {
    id:2,
    name: "gogi",
    image:
    "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.v0RiALj-qb0tA3TaocYnVAHaE7%26pid%3DApi&f=1",
    rating: 4.8
  },
  {
    id:3,
    name: "hamburger",
    image:
    "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.8HoZOyiA_V7Fg-hBzUSx6AHaEo%26pid%3DApi&f=1",
    rating: 4.3
  }
];

function Food({ name, pic, rating }){
  return (
  <div>
    <h2>I like {name}</h2>
    <h4>{rating}/5.0</h4>
    <img src={pic} alt={name}/>
  </div>
  );
}

Food.propTypes = {
  name: propTypes.string.isRequired,
  pic: propTypes.string.isRequired,
  rating: propTypes.string.isRequired
}

function App() { 
  return (
    <div className="App">
      {FoodILike.map( dish =>
        <Food name={dish.name} pic={dish.image} key={dish.id} rating={dish.rating} />
      )}
    </div>
  );
}

export default App;
